import "./homenav.css";
import logo from "../img/Group.png";
import { Link, NavLink } from "react-router-dom";
 function Homenav(){
    return(
        <>
         <nav>
            <div></div>
            
                   
                        
                    
         <div className="nav-button">
         
                        <NavLink to="/Login">
                        Login
                        </NavLink>
                    
         </div>



         

         </nav>
        </>
    );
 }
 export default Homenav;
